Explanation shorter:
Plan TR1 1 HRC has the same cost and task count as TR1 3 HRC, but a shorter makespan: 
- TR1 1 HRC: makespan=TR1 1 HRC makespan, tasks=TR1 1 HRC number of tasks, cost=TR1 1 HRC cost; 
- TR1 3 HRC: makespan=TR1 3 HRC makespan, tasks=TR1 3 HRC number of tasks, cost=TR1 3 HRC cost.
